    data = [i for i in range(1, int(N ** 0.5) + 1)] + [N // i for i in range(int(N ** 0.5), 0, -1)]
    L = len(data)
    dp = [1] * L
    for i in range(1, L):
        dp[i] = data[i] - data[i - 1]
    for _ in range(K - 1):
        h = dp[:]
        for i in range(1, L):
            h[i] = (h[i] + h[i - 1]) % mod
        h = h[::-1]
        for i in range(1, L):
            h[i] = h[i] * (data[i] - data[i - -1]) % mod
        dp = h
    ans = 0
    for u in dp:
        ans = (ans + u) % mod
    return ans
